import React from "react";

const Quotes = () => {
  const quotes = [{}, {}, {}, {}, {}, {}];
  return (
    <>
      <div className="parent">
        <nav></nav>
        <section className="quote-display">
          <div className="container-fluid">
            <div className="row">
              <div className="col-md-12 col-12"></div>
            </div>
            <div className="row">
              {quotes.maps((q, i) => (
                <div className="col-md-4 col-12">
                  <div className="single-quote"></div>
                </div>
              ))}
            </div>
          </div>
        </section>
      </div>
    </>
  );
};

export default Quotes;
